import React from "react";

class ViewJOBDetails extends React.Component {
  constructor(props) {
    super(props);
    this.state = { events: this.props.location.state.events };
  }
  render() {
    return (
      <div>
        ViewJOBDetails
        {this.state.events[0].jobid}
      </div>
    );
  }
}

export default ViewJOBDetails;
